INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES001', '2018-03-15 00:00:00', , 'Fallas de Valencia', 49.99, 'Las Fallas (Falles en valenciano) son unas fiestas que van del 15 al 19 de marzo con una tradición arraigada en la ciudad de Valencia y diferentes poblaciones de la Comunidad Valenciana. Oficialmente empiezan el último domingo de febrero con el acto de la Crida (en valenciano; \'pregón\', en español).\r\n\r\nActualmente, esta festividad se ha convertido en un atractivo turístico muy importante, ya que además de estar catalogadas como fiesta de Interés Turístico Internacional, en noviembre de 2016 la Unesco las inscribió en su Lista Representativa del Patrimonio Cultural Inmaterial de la Humanidad.2? Estas fiestas también son llamadas fiestas josefinas o festes de Sant Josep (en valenciano), ya que se celebran en honor de San José, patrón de los carpinteros, que era un gremio muy extendido en la ciudad cuando empezaron a celebrarse a finales del siglo XIX, y que conservó hasta la actualidad, dada la importancia de la industria del mueble en la región.', 'Fiesta + alcohol + petarditos', 150);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES002', '2018-12-10 00:00:00', , 'Viaje al polo', 999.99, 'Peary, Herbert, Uemura y otros míticos exploradores tuvieron que recorrer más de 800 kilómetros de mar helado antes de alcanzar el Polo Norte. Sin embargo, hoy es posible llegar a la cima del mundo en helicóptero.\r\nNuestro punto de partida será la estación temporal rusa \"Barneo\", situada en un témpano a la deriva en pleno Océano Ártico a 89º de latitud Norte. Desde allí, y en un vuelo de tan solo 40 minutos, llegaremos al soñadoPolo Norte geográfico.  Tras pasar un rato en el lugar más remoto de nuestro planeta iniciaremos el regreso.', 'Pingüinos + frio', 20),
('DES003', '2018-02-28 00:00:00', , 'Viaje a Australia', 369.99, 'Australia posee tesoros inolvidables: el desierto con las rocas sagradas de los aborígenes como Uluru, la costa con su inagotable Barrera de Coral, las vibrantes ciudades de Melbourne o Sidney y su insólita fauna.', 'Bichos raros + australianos', 100);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES004', '2018-06-23 00:00:00', , 'Hogueras de San Juan - Alicante', 50.75, 'La Fiesta de San Juan, también llamada víspera de San Juan o noche de San Juan es una festividad de origen pagano (Litha) celebrada el 23 de junio,1? víspera del día de San Juan Bautista, en la que se suelen encender hogueras o fuegos. El origen de esta costumbre se asocia con las celebraciones en las que se festejaba la llegada del solsticio de verano, el 21 de junio en el hemisferio norte, cuyo rito principal consiste en encender una hoguera. La finalidad de este rito era \"dar más fuerza al sol\", que a partir de esos días iba haciéndose más \"débil\" ?los días se van haciendo más cortos hasta el solsticio de invierno. Simbólicamente, el fuego también tiene una función \"purificadora\" en las personas que lo contemplaban.', 'Bebidas + hoguera', 150);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES005', '2018-08-04 00:00:00', , 'Descenso del Sella - Asturias', 60, 'Sin lugar a dudas el Descenso en canoa del río Sella es la actividad más practicada en la Comarca del Sella, junto a los Picos de Europa.\r\n\r\nDebido a la gran belleza del Río Sella, todos los años y en especial en meses de verano, el río se convierte en un mosaico de canoas de diferentes colores practicando el descenso del sella.', 'canoas + comida', 500);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES006', '2018-02-09 00:00:00', , 'Carnavales de Brasil', 195.5, 'El Carnaval de Brasil (Carnaval do Brasil en portugués) es una celebración anual que tiene lugar en Brasil con fecha variable entre febrero y marzo según el año. La fiesta se extiende por cuatro días y finaliza en la víspera al Miércoles de Ceniza (que marca el comienzo de la cuaresma). Tiene algunas variaciones con respecto a sus contrapartes europeas, y también diferencias a lo largo del territorio brasileño.', 'viaje + alojamiento', 200);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES007', '2018-08-04 00:00:00', , 'Summer Festival - Sevilla', 149.5, 'El mayor evento 100% breaks que se celebra en todo el planeta vuelve este año en una edición muy especial… POOL PARTY  & HOLI COLOURS EDITION, llenando de frescura y color la gran noche de verano en SEVILLA en las inigualables instalaciones de la Hacienda El Chaparrejo en Alcalá de Guadaira con CÉSPED, ÁRBOLES, PISCINA y mucho más ¡Todo un lujo!', 'entrada + alcohol', 300);
INSERT INTO `destinos` (`iddestino`, `fecha`, `imagen`, `nombre`, `precio`, `descripcion`, `descripcioncorta`, `numplazas`) VALUES
('DES008', '2018-03-15 00:00:00', , 'Auroras Boreales - Islandia', 750, 'Aurora polar (o aurora polaris) es un fenómeno en forma de brillo o luminiscencia que se presenta en el cielo nocturno, generalmente en zonas polares, aunque puede aparecer en otras zonas del mundo durante breves períodos. En el hemisferio sur es conocida como Aurora austral, y en el hemisferio norte como Aurora boreal, cuyo nombre proviene de Aurora, la diosa romana del amanecer, y de la palabra griega Bóreas, que significa norte.\r\n\r\nLos mejores momentos para observarla son entre septiembre y marzo en el hemisferio norte (aurora boreal), y entre marzo y septiembre en el hemisferio sur (aurora austral).', 'viaje + alojamiento', 50);

